import "../../assets/sass/sass-components/login-page/login-page.scss";

import React, { useEffect, useState } from "react";
import Axios from "axios";

import BackgroundContainer from "../container-components/background-container";
import NavbarContainer from "../container-components/navbar-container";

function LoginPage() {
  const [logindata, setLogindata] = useState({
    email: value.get("email"),
    password: value.get("password"),
  });

  const userLogin = () => {
    Axios.post("http://localhost:3001/login").then((response) => {
      setLogindata(response);
    });
  };
  useEffect(() => {
    userLogin();
    console.log(logindata);
  }, []);
  return (
    <div className="login-page-container">
      <NavbarContainer navCurrentPath="/Login" />
      <form action="" method="post">
        <div className="login-inputcontainer">
          <label for="email-input">Enter your email :D</label>
          <input className="inputborder" id="email-input" type="email"></input>
          <label for="password-input">Enter your password :V</label>
          <input
            className="inputborder"
            id="password-input"
            type="password"
          ></input>
          <input id="login-submitbtn" type="submit" value="Login"></input>
        </div>
      </form>
      <BackgroundContainer />
    </div>
  );
}

export default LoginPage;
